import React from "react";
import "./Left.css";


export default function Left() {
  return (
    <div>
     <div class = "sidebar">
     <ul class = "sidebarList">
         <li>
                <img src="../assets/img/dashboard.svg" alt=""/>
                <span>Dashboard</span>
              </li>
        
     </ul>
     </div>
    </div>
  );
}
